import Chatbot from 'react-chatbot-kit'
import ActionProvider1 from './ActionProvider1';
import MessageParser from './MessageParser';
import config from './config';
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Chatbot config={config} actionProvider={ActionProvider1} 	 messageParser={MessageParser} />

      </header>
    </div>
  );
}

export default App;
